CREATE DEFINER=`root`@`%` PROCEDURE `all_info` ()   BEGIN
SELECT c.email, c.phone, c.id, sum(p.quantity) as num_of_books, sum(p.quantity * b.price) as total
from clients c
LEFT JOIN purchase_check p on c.id = p.client
LEFT JOIN books b on p.book = b.id
GROUP BY c.id, c.email, c.phone;
END$$

CREATE DEFINER=`root`@`%` PROCEDURE `book_for_client` (IN `client_id_in` INT)   BEGIN
SELECT LEFT(TO_BASE64(b.photo), 10) as photo, b.name, p.date_of_purchase, p.quantity from books b 
join purchase_check p on b.id = p.book
WHERE p.client = client_id_in;
END$$

